import styled from "styled-components";

export const Botones = styled.button `

`;

export const DivCard = styled.div `
   display: flex;
   justify-content: center;
   align-items: center; 
`;  

export const Titulos = styled.h2 `

`;

export const Imagenes = styled.img `

`;

function Card(props) {
   return (
      <DivCard>
         <Botones onClick={props.onClose}>X</Botones>
         <Titulos>{props.name}</Titulos>
         <Titulos>{props.species}</Titulos>
         <Titulos>{props.gender}</Titulos>
         <Imagenes  src={props.image} alt={''} />
      </DivCard>
   );
}
export default Card;
